import {Form, Card} from "react-bootstrap";
const Signup = () => {
    return ( 
        <Card style={{"margin":"20px 270px 20px 270px"}}>
            <Form>
              <Form.Group controlId="fromEmail" >
                <h4>Email</h4><br></br>
                <Form.Control style={{"margin":"auto"}} className="w-75" type="email" placeholder="exmple@mail.com"/>
          </Form.Group>
        </Form>
        </Card>
     );
}
 
export default Signup;
